          <Typography />
          <Javascript />
          <Carousel />
          <NucleoIcons />
          <CompleteExamples />
          <SignUp />
          <Examples />
          <Download /> */}
        {/* <DarkFooter /> */}
      </div>
    </>
  );
}

export default Index;
